function serversByCountry(){var e=new XMLHttpRequest;e.open("GET","http://localhost:8080/v1/servers-by-country",!0),e.onload=function(){if(this.status>=200&&this.status<400){var e=JSON.parse(this.response);const r={type:"bar",data:{labels:e.labels,datasets:[{label:"Exposed Redis Servers By Country",backgroundColor:"#cd5d57",borderColor:"rgb(255, 99, 132)",data:e.data}]},options:{indexAxis:"y"}};window.serversByCountryChart&&window.serversByCountryChart.destroy(),window.serversByCountryChart=new Chart(document.getElementById("servers-by-country"),r)}else console.log("Failed to render report")},e.onerror=reportError,e.send()}function serversByVersion(){var e=new XMLHttpRequest;e.open("GET","http://localhost:8080/v1/servers-by-version",!0),e.onload=function(){if(this.status>=200&&this.status<400){var e=JSON.parse(this.response);const r={type:"bar",data:{labels:e.labels,datasets:[{label:"Exposed Redis Servers By Version",backgroundColor:"#cd5d57",borderColor:"rgb(255, 99, 132)",data:e.data}]},options:{indexAxis:"y"}};window.serversByVersionChart&&window.serversByVersionChart.destroy(),window.serversByVersion=new Chart(document.getElementById("servers-by-version"),r)}else console.log("Failed to render report")},e.onerror=reportError,e.send()}function reportError(){console.log("Failed to fetch report")}document.addEventListener("DOMContentLoaded",function(e){serversByCountry(),serversByVersion()},{once:!0});
